import React, { Component } from "react";
import Skills from "./components/skills";
import Contact from "./components/contact";
import Navbar from "./components/navbar";

class Main extends Component {
    render() {
        return (
            <div className="application">
                <Navbar/>
                <Skills/>
                <Contact/>
            </div>
        );
      }
    }
export default Main;
